import React from 'react';
import {
    View,
    Text,
    StyleSheet,
    Image,
    ScrollView,
    TouchableOpacity
} from 'react-native';
import BackHeader from './backDrawerHeader';
import Card from './card2';
import * as Animatable from "react-native-animatable";


export default function appDrawer({state, setState}) {


    return (
        <ScrollView>
            <BackHeader state={state}
                setState={setState}/>
        <Animatable.View animation>
            <Card>
                <View>
                    <View>
                        <TouchableOpacity onPress={
                            () => setState({
                                ...state,
                                page: 4
                            })
                        }>
                            <Text style={
                                styles.infosell
                            }>Browse All</Text>
                        </TouchableOpacity>
                    </View>

                    <View>
                        <TouchableOpacity onPress={
                            () => setState({
                                ...state,
                                page: 4
                            })
                        }>
                            <Text style={
                                styles.infosell
                            }>Notifications</Text>
                        </TouchableOpacity>
                    </View>

                    <View>
                        <TouchableOpacity onPress={
                            () => setState({
                                ...state,
                                page: 4
                            })
                        }>
                            <Text style={
                                styles.infosell
                            }>Account</Text>
                        </TouchableOpacity>
                    </View>
                    </View>
                </Card>
                <Text style={
                    {
                        fontSize: 30,
                        padding: 10
                    }
                }>
                    Categories
                </Text>  

    <Card>
            <View>
                <TouchableOpacity onPress={
                    () => setState({
                        ...state,
                        page: 4
                    })
                }>
                    <Text style={
                        styles.infoselltoo
                    }>Vehicles</Text>
                </TouchableOpacity>
            </View>

            <View>
                <TouchableOpacity onPress={
                    () => setState({
                        ...state,
                        page: 4
                    })
                }>
                    <Text style={
                        styles.infoselltoo
                    }>Property Rentals</Text>
                </TouchableOpacity>
            </View>
            <View>
                <TouchableOpacity onPress={
                    () => setState({
                        ...state,
                        page: 4
                    })
                }>
                    <Text style={
                        styles.infoselltoo
                    }>Apparel</Text>
                </TouchableOpacity>
            </View>
            <View>
                <TouchableOpacity onPress={
                    () => setState({
                        ...state,
                        page: 4
                    })
                }>
                    <Text style={
                        styles.infoselltoo
                    }>Electronics</Text>
                </TouchableOpacity>
            </View>
            <View>
                <TouchableOpacity onPress={
                    () => setState({
                        ...state,
                        page: 4
                    })
                }>
                    <Text style={
                        styles.infoselltoo
                    }>Office supplies</Text>
                </TouchableOpacity>
            </View>
        </Card>
        </Animatable.View>
        </ScrollView>
    )
}


const styles = StyleSheet.create({
    takemedown: {
        marginTop: 100
    },
    infosell: {
        flex: 1,
        color: 'white',
        alignItems: 'center',
        marginHorizontal: 10,
        marginVertical: 10,
        padding: 20,
        backgroundColor: '#2fa8e0',
        borderWidth: 1,
        borderColor: '#DDD',
        borderRadius: 10,
        //marginRight: 100,
        //marginLeft: 100
    },
    infoselltoo: {
        flex: 1,
        color: 'white',
        alignItems: 'center',
        marginHorizontal: 10,
        marginVertical: 10,
        padding: 20,
        backgroundColor: '#659fba',
        borderWidth: 1,
        borderColor: '#DDD',
        borderRadius: 10,
        //marginRight: 100,
        //marginLeft: 100
    },
});
